import React from 'react';
import { useSelector } from 'react-redux';
import { Redirect } from 'react-router-dom';

const Profile = () => {
    // Fetch userAuthenticated from the Redux store
    const userAuthenticated = useSelector(state => state.auth.userAuthenticated);

    // Redirect to root ("/") if user is not authenticated
    if (!userAuthenticated) {
        return <Redirect to="/" />;
    }

    // Render the component only when userAuthenticated is true
    return (
        <h1>Profile</h1>
    );
}

export default Profile;
